// Helper function to get component by its ID
export function getComponentByID(componentId: string) {
  const component = COMPONENTS[componentId];
  const metadata = COMPONENT_METADATA[componentId];
  
  if (!component || !metadata) {
    console.error(`Component not found: ${componentId}`);
    return null;
  }
  
  return {
    Component: component,
    metadata,
    filePath: `components/${metadata.importPath}.tsx`
  };
}

// Helper function to get all components in a category
export function getComponentsByCategory(category: string) {
  return Object.entries(COMPONENT_METADATA)
    .filter(([_, metadata]) => metadata.category === category)
    .map(([componentName, metadata]) => ({
      componentName,
      ...metadata,
      Component: COMPONENTS[componentName]
    }));
}
